import {router} from "../Utils/router";
import Index from "../Pages/HomePage/Index"
import IndexAbout from "../Pages/AboutPage/Index"
import {useIntl} from "react-intl";

export const RoutesData = ()=>{

    const {formatMessage} = useIntl()
    return {mains : [
            {
                url: router.home,
                component: Index,
                layout: "home",
                title: ""
            },
            {
                url: router.about,
                component: IndexAbout,
                layout: "about",
                title: formatMessage({id : "about"})
            },
            {
                url: router.about,
                component: IndexAbout,
                layout: "about",
                title: formatMessage({id : "project"})
            },
            {
                url: router.about,
                component: IndexAbout,
                layout: "about",
                title: formatMessage({id : "contact"})
            },
        ]}
}
